/* CONTAINER */
.slds-col_padded, .slds-col--padded{
    padding-left: 0 !important;
    padding-right: 0 !important;
}

.slds-p-horizontal_medium, .slds-p-horizontal--medium{
    padding-left: 0 !important;
    padding-right: 0 !important;
}

.siteforceContentArea .comm-layout-column:not(:empty){
    padding-bottom: 0 !important;
    padding-top: 0 !important;
}

/* HEADER */
.siteforcePrmBody .cHeader .cHeaderTop{
    background-color: #444444 !important;
    height: 48px !important;
}

.siteforcePrmBody .cHeaderTopInternalWrapper{
    height: 100%;
}

.siteforcePrmBody .cHeader .cBrandingLogo{
    height: 48px !important;
    width: 127px !important;
}

.forceCommunityGlobalNavigation{
    background-color: #ffffff;
    box-shadow: 0 1px 2px 0 rgba(68, 68, 68, 0.24);
}

.siteforcePrmBody .cHeader .cSearch{
    display: none;
}

.siteforcePrmBody .cHeaderTopInternalWrapper{
    margin: auto !important;
    max-width: 1184px !important;
    padding: 0 !important;
}

.siteforcePrmBody .cHeader .selfServiceProfileMenuTrigger .profileName{
    display: none;
}

.siteforcePrmBody .cHeader .selfServiceProfileMenuTrigger .triggerDownArrow{
    display: none;
}

.siteforcePrmBody .comm-navigation>*{
    max-width: 1184px !important;
}

/* HEADER - TABS */
.forceCommunityGlobalNavigation{
    background-color: #ffffff !important;
    box-shadow: 0 1px 2px 0 rgba(68, 68, 68, 0.24);
    color: #444444 !important;
}

.forceCommunityGlobalNavigation .slds-list_horizontal>.slds-list__item>.comm-navigation__item>button.slds-is-active:not([data-type="home"]){
    background-color: rgba(236, 0, 0, 0.04) !important;
    box-shadow: inset 0 -1px 0 0 #ec0000;
}

.slds-icon_xx-small{
    width: 0.6rem;
    height: 0.6rem;
}

.slds-button__icon--right{
    margin-left: 12px !important;
}

lightning-primitive-icon{
    align-items: center;
    display: flex;
}

.slds-p-horizontal_x-small, .slds-p-horizontal--x-small{
    padding: 0;
}

a.slds-container_fluid.slds-truncate.slds-is-active{
    background-color: rgba(236, 0, 0, 0.04);
    box-shadow: inset 0 -1px 0 0 #ec0000;
}

ul.slds-list_vertical.slds-is-nested.slds-is-absolute a.slds-container_fluid.slds-truncate.slds-is-active{
    box-shadow:none !important;
}

a.slds-container_fluid.slds-truncate{
    font-size: 12px !important;
}

a:hover.slds-container_fluid.slds-truncate{
    background-color: #f6f6f6 !important;
}

ul.slds-list_vertical.slds-is-nested.slds-is-absolute{
    margin-top: 4px;
    padding: 8px 0;
}

.siteforcePrmBody .comm-navigation .comm-navigation__item a {
    padding: 8px 36px 8px 16px !important;
}

.slds-icon-utility-home{
    content:url('/sfsites/c/resource/Community_Home') !important;
    height: 20px !important;
    width: 20px !important;
}

.siteforcePrmBody .comm-navigation{
    min-height: 36px !important;
}

.siteforcePrmBody .comm-navigation .comm-navigation__item button {
    padding: 8.4px 12px 8.4px 16px !important;
}

.siteforcePrmBody .comm-navigation .comm-navigation__item a{
    padding: 6px 14px !important;
}

.slds-button:focus{
    box-shadow: none;
}

.forceCommunityGlobalNavigation .slds-list_vertical{
    background-color: #ffffff !important;
}

button.slds-container_fluid.slds-button.slds-button--reset.slds-truncate:hover{
    background-color: #f6f6f6 !important;
}
button.slds-container_fluid.slds-button.slds-button--reset.slds-truncate:active{
    box-shadow: inset 0 -1px 0 0 #ec0000;
}

/* HEADER - PROFILE */
.siteforcePrmBody .cHeader .selfServiceProfileMenuTrigger .profileIcon{
   /* border-radius: initial !important;
          content: url('/sfsites/c/resource/Community_Profile') !important;*/
    height: 32px !important;
    width: 32px !important;
}
/*BODY*/
.siteforcePrmBody .cCenterPanel{
  padding-top:54px !important;
  padding-bottom: 112px;
}
.siteforcePrmBody{
    z-index: 0;
    position:absolute;
          min-height: calc(100vh - 32px);
}
